  return (
    <Card>
      <Card.Content>
        <Image
          floated='right'
          size='small'
          src={telefonica}
        />
        <Card.Header>{name}</Card.Header>
        <Card.Meta>Reputaci√≥n: <strong>{reputation}</strong></Card.Meta>
      </Card.Content>
      <Card.Content extra>
        <div className='ui two buttons'>
          <Button basic color='blue' onClick={company}>
            Ver empresa
          </Button>
        </div>
      </Card.Content>
    </Card>
  )
}

